import React from 'react';
import '../css/styles.css'
import Layout from '../layout';


function MyApp({Component, pageProps}){
  return(
    <div>
      <Layout>
        <Component {...pageProps}/>
      </Layout>
 
    </div>
  )
}

export default MyApp
